document.addEventListener('click', e => {
    if (e.target.matches('.collapsible-btn')) {
        const target = document.getElementById(e.target.dataset.target);
        const parent = e.target.closest('.collapsible-btn-container');
        
        e.target.classList.toggle('open');
        target.classList.toggle('open');
        
        if (target.classList.contains('open')) {
            target.style.maxHeight = '0';
            requestAnimationFrame(() => {
                target.style.maxHeight = target.scrollHeight + 'px';
            });
        } else {
            target.style.maxHeight = '0';
        }
        
        parent.classList.toggle('focused');
        e.target.blur();
        
        const headerCollapsibles = document.querySelectorAll('.header-collapsible');
        const anyOpen = Array.from(headerCollapsibles).some(el => el.classList.contains('open'));
        
        document.body.classList.toggle('header-collapsible-open', anyOpen);
        
        const mainHeading = document.querySelector("h1");
        if (anyOpen) {
            mainHeading.classList.add('collapsible-override');
        } else {
            mainHeading.classList.remove('collapsible-override');
        }
    }
});

let resizeTimeout;
window.addEventListener('resize', () => {
    clearTimeout(resizeTimeout);
    resizeTimeout = setTimeout(() => {
        document.querySelectorAll('.collapsible-content.open').forEach(el => {
            el.style.maxHeight = el.scrollHeight + 'px';
        });
    }, 100);
});

const fadeableSpan = document.querySelector("h1 .fadeable");
const firstStickyHeading = document.querySelector('.first-sticky');
const mainHeading = document.querySelector("h1");
let ticking = false;
let hasScrolledPast = false;

function checkStickyPosition() {
    const stickyPosition = firstStickyHeading.getBoundingClientRect().top;
    const spanPosition = fadeableSpan.getBoundingClientRect().top;
    const tolerance = window.innerWidth * 0.015;
    
    if (Math.abs(stickyPosition - spanPosition) <= tolerance || stickyPosition < spanPosition) {
        hasScrolledPast = true;
        mainHeading.classList.add('scrolled');
    } else if (hasScrolledPast && stickyPosition > spanPosition + tolerance) {
        hasScrolledPast = false;
        mainHeading.classList.remove('scrolled');
    }
    
    ticking = false;
}

function requestTick() {
    if (!ticking) {
        requestAnimationFrame(checkStickyPosition);
        ticking = true;
    }
}

window.addEventListener('scroll', requestTick, { passive: true });
window.addEventListener('resize', requestTick);
checkStickyPosition();
